using System.ComponentModel.DataAnnotations;
using System.Text.Json.Serialization;

namespace bg.hd.banca.pyme.domain.entities.biometria
{
    public class ImagenTokenizadaRequest
    {
        /// <summary>
        /// Producto
        /// </summary>
        /// <example>cuotaMensual</example>
        public string Producto { get; set; } = "";
        /// <summary>
        /// Identificacion
        /// </summary>
        /// <example>0925298358</example>
        [Required]
        [RegularExpression("^[0-9]*$", ErrorMessage = "La identificación debe ser númerica")]
        [StringLength(10, ErrorMessage = "La identificación debe tener 10 caracteres", MinimumLength = 10)]
        public string Identificacion { get; set; } = "";
        /// <summary>
        /// CodigoDactilar
        /// </summary>
        /// <example></example>
        public string? CodigoDactilar { get; set; } = "";
        /// <summary>
        /// IdSolicitud
        /// </summary>
        /// <example>45807</example>
        public string IdSolicitud { get; set; } = "";
        /// <summary>
        /// NavegadorWeb
        /// </summary>
        /// <example>Navegador Example</example>
        public string NavegadorWeb { get; set; } = "";
        /// <summary>
        /// DispositivoOrigen
        /// </summary>
        /// <example>Device Example</example>
        public string DispositivoOrigen { get; set; } = "";
        /// <summary>
        /// VersionOrigen
        /// </summary>
        /// <example>version 0.0.1</example>
        public string VersionOrigen { get; set; } = "";
        public string TieneCamara { get; set; } = "";
        [JsonIgnoreAttribute] public string Aplicacion { get; set; } = "";
        [JsonIgnoreAttribute] public string TipoValidacionBiometria { get; set; } = "";
        /// <summary>
        /// FotoTokenizada
        /// </summary>
        /// <example></example>
        public string FotoTokenizada { get; set; } = "";
        [JsonIgnoreAttribute] public bool generarExcepcion { get; set; } = true;
        [JsonIgnoreAttribute] public string IpCliente { get; set; } = "";
    }
}
